const start = () => {
  setTimeout(() => {
    if (variableRef.current) {
      const data = variableRef.current.detailExecData
      data.status = 'running'
      const list = data.template
      for (let i = 0; i < list.length; i++) {
        const stage = list[i]
        if (stage.status === 'pending') {
          stage.status = 'running'
          break
        }
        for (let j = 0; j < stage.jobs.length; j++) {
          const job = stage.jobs[j]
          if (job.status === 'pending') {
            job.status = 'running'
            break
          }
          for (let k = 0; k < job.tasks.length; k++) {
            const step = job.tasks[k]
            if (step.status === 'pending') {
              step.status = 'running'
              break
            }
            if (step.status === 'running') {
              step.status = 'success'
              if (k === job.tasks.length - 1) {
                job.status = 'success'
                if (i === list.length - 1 && j === stage.jobs.length - 1) {
                  if (pipelineId === '2') {
                    step.status = 'failed'
                    job.status = 'failed'

                  }
                }
              }
              break
            }
          }
          if (job.status === 'running') {

            break
          }
          if (j === stage.jobs.length - 1) {
            stage.status = 'success'
            if (i === list.length - 1) {
              if (pipelineId === '2') {
                stage.status = 'failed'
              }
            }

            break
          }
        }
        if (stage.status === 'running') {
          break
        }
      }
      start()

      variableRef.current.detailExecData = data
    }
  }, 5000);
}

